import { Button } from 'react-bootstrap';
import { Photo } from '../../redux/reducer';
import MenuItem from './MenuItem';
interface Props {
  data: Array<Photo>;
}
function Menu({ data }: Props) {
  return (
    <div style={{ border: '1px solid #f0f0f0', padding: '30px', minHeight: '200vh', borderRadius: '6px' }}>
      <div className="d-flex justify-content-center flex-column" style={{ position: 'sticky', top: '20px' }}>
        {data.map((el, index) => {
          return <MenuItem data={el} />;
        })}
        <Button className="me-2" style={{ minWidth: '200px' }}>
          Confirm
        </Button>
        <Button color="warn" style={{ minWidth: '200px' }}>
          Reset
        </Button>
      </div>
    </div>
  );
}

export default Menu;
